import React, { useState, useEffect } from 'react';

export default function About() {
    const [mode, setMode] = useState('light');

    useEffect(() => {
        document.title = "About - Deep Dream Creations";
    }, []);

    const getStyles = () => {
        return {
            container: {
                maxWidth: '1200px',
                margin: '0 auto',
                padding: '20px',
                marginTop: '70px',
                fontFamily: 'Arial, sans-serif',
            },
            heading: {
                fontSize: '30px',
                fontWeight: 'bold',
                marginBottom: '7px',
                marginTop: '7px',
                color: mode === "light" ? '#333' : '#fdf6e4',
                textAlign: 'center',
                textTransform: 'uppercase',
            },
            subHeading: {
                fontSize: '24px',
                fontWeight: 'bold',
                marginTop: '40px',
                marginBottom: '10px',
                color: mode === "light" ? '#333' : '#fdf6e4'
            },
            paragraph: {
                fontSize: '18px',
                marginBottom: '15px',
                lineHeight: '1.6',
                color: mode === "light" ? '#333' : '#fdf6e4'
            },
            list: {
                listStyleType: 'circle',
                paddingLeft: '20px',
                fontSize: '18px',
                marginBottom: '15px',
                color: mode === "light" ? '#333' : '#fdf6e4'
            },
            thankYou: {
                marginTop: '40px',
                fontStyle: 'italic',
                color: mode === "light" ? '#777' : 'orange'
            }
        };
    }

    const styles = getStyles();

    return (
        <div style={styles.container}>
            <h1 className="text-center" style={styles.heading}>About Deep Dream Creations</h1>
            <h2 style={styles.subHeading}>Our Vision</h2>
            <p style={styles.paragraph}>At Deep Dream Creations, we believe in the power of artistic expression and technology fusion. Our platform empowers users to unleash their creativity by uploading photos and applying customized Deep Dream effects.</p>

            <h2 style={styles.subHeading}>Key Features</h2>
            <p style={styles.paragraph}>Discover the exciting features of Deep Dream Creations:</p>
            <ul style={styles.list}>
                <li style={styles.list}>Upload Your Photos: Seamlessly upload your photos to the platform and transform them with stunning Deep Dream effects.</li>
                <li style={styles.list}>Customize Effects: Choose from a range of styles and parameters to customize the Deep Dream effects according to your preferences.</li>
                <li style={styles.list}>Purchase Options: Explore options to purchase prints or digital copies of your creations, allowing you to showcase your artwork in various formats.</li>
                <li style={styles.list}>Community Engagement: Engage with a vibrant community of artists and enthusiasts, share your creations, and explore inspiring works from others.</li>
            </ul>

            <h2 style={styles.subHeading}>Explore Endless Creativity</h2>
            <p style={styles.paragraph}>Deep Dream Creations offers a dynamic platform for artistic exploration:</p>
            <ul style={styles.list}>
                <li style={styles.list}><strong>Style Variety:</strong> Choose from a diverse range of Deep Dream styles, from surrealistic landscapes to abstract patterns, and bring your visions to life.</li>
                <li style={styles.list}><strong>Parameter Control:</strong> Fine-tune the parameters of your Deep Dream effects, including intensity, color palette, and dream-like distortions, to achieve the perfect artistic expression.</li>
                <li style={styles.list}><strong>Artwork Purchase:</strong> Showcase your creations with pride by purchasing prints or digital copies, ideal for personal collections or gifting.</li>
                <li style={styles.list}><strong>Artistic Community:</strong> Connect with fellow artists, share tips and techniques, and discover new inspirations within a supportive and creative community.</li>
            </ul>

            <h2 style={styles.subHeading}>Join the Deep Dream Revolution</h2>
            <p style={styles.paragraph}>Experience the fusion of art and technology with Deep Dream Creations. Unleash your imagination, create captivating artworks, and embark on a journey of artistic discovery.</p>

            <p style={styles.thankYou}>Thank you for being a part of the Deep Dream revolution and for embracing the limitless possibilities of digital artistry.</p>
        </div>
    );
}
